    "cbcbe5ec-565d-4228-9947-b145a022e6c1": {"id":"cbcbe5ec-565d-4228-9947-b145a022e6c1","project_id":14266,"key":36582612,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:35.021Z","updated_at":"2022-09-26T00:29:35.021Z","props":{"content":"\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhaling – acting on it\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eAs soon as you identify a whaling threat, you need to act. There are two main actions you can take…\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "f11346f0-cb00-4b49-bf21-636e9d28f4a4": {"id":"f11346f0-cb00-4b49-bf21-636e9d28f4a4","project_id":14266,"key":36582611,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:35.015Z","updated_at":"2022-09-26T00:29:35.015Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003e4. Checking links\u003c/span\u003e\u003c/strong\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#282a2b\" data-type=\"color\"\u003eWith the ‘MadMountain’ email, Jen did check the full sender’s address but was unsure as it looked like the real thing. However, as the race was on her mind, she opened the email anyway as it looked important. She is still rightly suspicious about it, and is confused about what to do.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#282a2b\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eWhat two actions could she take below?\u003c/strong\u003e\u003c/span\u003e\u003c/p\u003e"},"type":"Text"}, 
    "b290d50c-7d95-4ce3-98c4-f8f8154559a0": {"id":"b290d50c-7d95-4ce3-98c4-f8f8154559a0","project_id":14266,"key":36582610,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:35.010Z","updated_at":"2022-09-26T00:29:35.010Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003e2. Marina\u0026#x27;s reflection\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#282a2b\" data-type=\"color\"\u003eAfter the dust settled, and there sure was a lot of it, Marina had a chance to think more carefully about how to keep on top of the currency of her ICT assets.\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"color:#282a2b\" data-type=\"color\"\u003e\u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#282a2b\" data-type=\"color\"\u003eWhat’s the best way to ensure ICT assets do not become outdated?\u003c/span\u003e\u003c/strong\u003e\u003c/p\u003e"},"type":"Text"}, 
    "a8f9fe5d-dbae-42ac-a288-169c63098710": {"id":"a8f9fe5d-dbae-42ac-a288-169c63098710","project_id":14266,"key":36582609,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:35.004Z","updated_at":"2022-09-26T00:29:35.004Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eAsk your IT department to tell you when to update ICT assets\u003c/p\u003e"},"type":"Text"}, 
    "2b396bff-3e52-43c0-a249-673749e6b3c7": {"id":"2b396bff-3e52-43c0-a249-673749e6b3c7","project_id":14266,"key":36582608,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:34.996Z","updated_at":"2022-09-26T00:29:34.996Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eMake ICT currency reporting part of regular executive meetings\u003c/p\u003e"},"type":"Text"}, 
    "54d5b950-52b7-48ae-9894-08509fdff17a": {"id":"54d5b950-52b7-48ae-9894-08509fdff17a","project_id":14266,"key":36582607,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:34.989Z","updated_at":"2022-09-26T00:29:34.989Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eRegularly check the internet for hardware and software expiry\u003c/p\u003e"},"type":"Text"}, 
    "348f4e39-635d-49df-a3ff-0fe93155d588": {"id":"348f4e39-635d-49df-a3ff-0fe93155d588","project_id":14266,"key":36582606,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:34.982Z","updated_at":"2022-09-26T00:29:34.982Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eSpot on!\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eRegular ICT currency reporting at executive meetings is certainly a strong way to keep these issues front of mind so that updating assets can be planned for and risks mitigated. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eExecutives and senior leaders need to own the actions from these meetings so that risks are efficiently and appropriately managed.\u003c/p\u003e"},"type":"Text"}, 
    "8ae40d2b-6f2d-463e-9973-b801c6675179": {"id":"8ae40d2b-6f2d-463e-9973-b801c6675179","project_id":14266,"key":36582605,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:34.977Z","updated_at":"2022-09-26T00:29:34.977Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eUh oh!\u003c/strong\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eRegular ICT currency reporting at executive meetings is certainly a strong way to keep these issues front of mind so that updating assets can be planned for and risks mitigated. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eExecutives and senior leaders need to own the actions from these meetings so that risks are efficiently and appropriately managed.\u003c/p\u003e"},"type":"Text"}, 
    "b92cd7f1-bd88-4510-a2f7-4e5050a7d75a": {"id":"b92cd7f1-bd88-4510-a2f7-4e5050a7d75a","project_id":14266,"key":36582604,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:34.971Z","updated_at":"2022-09-26T00:29:34.971Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003eWhale quiz\u003c/span\u003e\u003c/strong\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eLet’s look in more depth at what whaling can look like so you can identify it and then know what you need to do about it. Have a go at these five questions.\u003c/p\u003e"},"type":"Text"}, 
