    "ca721edf-8481-4b7a-b937-6e8c13d8d6fc": {"id":"ca721edf-8481-4b7a-b937-6e8c13d8d6fc","project_id":14266,"key":36582273,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:31.361Z","updated_at":"2022-09-26T00:29:31.361Z","props":{"content":"\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cspan style=\"font-size:18px\" data-type=\"fontSize\"\u003eYou receive and spot a whaling email. You haven’t clicked any links. Report it by clicking on the ‘Report Spam’ button.\u003c/span\u003e\u003c/div\u003e"},"type":"Text"}, 
    "5b84590a-3e8f-4419-b623-cc5a296df884": {"id":"5b84590a-3e8f-4419-b623-cc5a296df884","project_id":14266,"key":36582272,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:31.352Z","updated_at":"2022-09-26T00:29:31.352Z","props":{"content":"\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003cspan style=\"font-size:18px\" data-type=\"fontSize\"\u003eYou didn’t spot it until you clicked on a link or downloaded a file. Escalate immediately by reporting to your agency’s ICT security team – they’’ report it to the Victorian Government’s Cyber Incident Response Service (CIRS).\u003c/span\u003e\u003c/div\u003e"},"type":"Text"}, 
    "40ce5acc-2c74-4312-a5ce-45a5030460d4": {"id":"40ce5acc-2c74-4312-a5ce-45a5030460d4","project_id":14266,"key":36582271,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:31.342Z","updated_at":"2022-09-26T00:29:31.342Z","props":{"content":"\u003cul data-type=\"bulleted-list\"\u003e\u003cli data-type=\"list-item\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eCheck your social media habits and privacy settings.\u003c/span\u003e\u003c/li\u003e\u003cli data-type=\"list-item\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eReport anything suspicious using the ‘Report Spam’ button.\u003c/span\u003e\u003c/li\u003e\u003cli data-type=\"list-item\"\u003e\u003cspan style=\"color:#272930\" data-type=\"color\"\u003eIf you do access any links or engage with material in the whaling email escalate immediately to your agency’s ICT security team. \u003c/span\u003e\u003c/li\u003e\u003c/ul\u003e"},"type":"Text"}, 
    "1af89ae1-0fd6-4256-ba48-8afa0fa3e931": {"id":"1af89ae1-0fd6-4256-ba48-8afa0fa3e931","project_id":14266,"key":36582270,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:31.334Z","updated_at":"2022-09-26T00:29:31.334Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOnly the Microsoft OneDrive address was legitimate. She reported the rest using the ‘Report spam’ button.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eRemember to look at the end of the domain name – the right hand side of the address. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eDoes this part of the address…\u003c/p\u003e\u003cul data-type=\"bulleted-list\"\u003e\u003cli data-type=\"list-item\"\u003ematch with the organisation\u003c/li\u003e\u003cli data-type=\"list-item\"\u003ehave any spelling mistakes\u003c/li\u003e\u003cli data-type=\"list-item\"\u003econtain random numbers and letters\u003c/li\u003e\u003cli data-type=\"list-item\"\u003euse a gmail, yahoo etc domain?\u003c/li\u003e\u003c/ul\u003e"},"type":"Text"}, 
    "f8811d2a-d45d-42e6-b59c-b510454c9dfa": {"id":"f8811d2a-d45d-42e6-b59c-b510454c9dfa","project_id":14266,"key":36582269,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:31.329Z","updated_at":"2022-09-26T00:29:31.329Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOnly the Microsoft OneDrive address was legitimate. She reported the rest using the ‘Report spam’ button.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eRemember to look at the end of the domain name – the right hand side of the address. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eDoes this part of the address…\u003c/p\u003e\u003cul data-type=\"bulleted-list\"\u003e\u003cli data-type=\"list-item\"\u003ematch with the organisation\u003c/li\u003e\u003cli data-type=\"list-item\"\u003ehave any spelling mistakes\u003c/li\u003e\u003cli data-type=\"list-item\"\u003econtain random numbers and letters\u003c/li\u003e\u003cli data-type=\"list-item\"\u003euse a gmail, yahoo etc domain?\u003c/li\u003e\u003c/ul\u003e"},"type":"Text"}, 
    "59557e53-84b6-4342-8086-a3e01e260fc7": {"id":"59557e53-84b6-4342-8086-a3e01e260fc7","project_id":14266,"key":36582268,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:31.322Z","updated_at":"2022-09-26T00:29:31.322Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn a laptop/desktop she can check the real address by right-clicking or hovering on the display name for more information.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eOn a mobile device she can also find out the full sender’s address by selecting the email and then selecting the display name to see the full address. Depending on your device and set-up there may be other ways you can check – practise on your devices after completing this.\u003c/p\u003e"},"type":"Text"}, 
