    "8bd285b9-1a59-42c2-ad52-633546290e22": {"id":"8bd285b9-1a59-42c2-ad52-633546290e22","project_id":14266,"key":36582803,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:36.763Z","updated_at":"2022-09-26T00:29:36.763Z","props":{"useBackgroundControls":true,"borderRadius":0,"content":"\u003cp data-type=\"paragraph\"\u003eThe Protective Marker selected will display in the footer of your document. \u003c/p\u003e"},"type":"Text"}, 
    "bb728ea1-25c0-4729-b67c-3fd4d0c06b9d": {"id":"bb728ea1-25c0-4729-b67c-3fd4d0c06b9d","project_id":14266,"key":36582802,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:36.755Z","updated_at":"2022-09-26T00:29:36.755Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThis email is marked SECRET and should not have been emailed\u003c/p\u003e"},"type":"Text"}, 
    "98a4a267-4e67-4650-8fe5-32c3bce0dd93": {"id":"98a4a267-4e67-4650-8fe5-32c3bce0dd93","project_id":14266,"key":36582801,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:36.749Z","updated_at":"2022-09-26T00:29:36.749Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThis email is marked PROTECTED CABINET-IN-CONFIDENCE and can only be shared within authorised domains\u003c/p\u003e"},"type":"Text"}, 
    "8b6e139c-af36-4d6f-a924-043b845b4662": {"id":"8b6e139c-af36-4d6f-a924-043b845b4662","project_id":14266,"key":36582799,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:36.736Z","updated_at":"2022-09-26T00:29:36.736Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eThe next day Helena receives an email marked as Official. She can clearly see the Protective Marker shown at the top and knows how to handle the information.\u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
    "c6adbdf5-af7b-4a8a-8c83-d0a61d71f795": {"id":"c6adbdf5-af7b-4a8a-8c83-d0a61d71f795","project_id":14266,"key":36582798,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:36.732Z","updated_at":"2022-09-26T00:29:36.732Z","props":{"content":"\u003cdiv class=\"chameleon-text-align-left\" data-type=\"textAlignLeft\"\u003e\u003cp data-type=\"paragraph\"\u003eHelena finds out she can apply a Protective Marker easily using the toolbar displayed when composing an email. \u003c/p\u003e\u003c/div\u003e"},"type":"Text"}, 
