    "17b36536-78b4-449d-b49e-3bf720eff125": {"id":"17b36536-78b4-449d-b49e-3bf720eff125","project_id":14266,"key":36582082,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.893Z","updated_at":"2022-09-26T00:29:29.893Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eXin clicks the link and is directed to the Craigieburn Pirates fixtures page. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThere’s lots of information on the page but nothing that seems to affect her so she assumes everything is okay.\u003c/p\u003e"},"type":"Text"}, 
    "3b480169-2f69-4fb5-989b-cb4903500949": {"id":"3b480169-2f69-4fb5-989b-cb4903500949","project_id":14266,"key":36582081,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.862Z","updated_at":"2022-09-26T00:29:29.862Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eFrom here the hacker sends Xin an email from a ‘spoofed’ domain – an address that looks like it’s from her son’s club. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThe email gives her an update on fixtures for her son’s team, and she just needs to click the link in the email.\u003c/p\u003e"},"type":"Text"}, 
    "e48237fd-9971-4c7f-82f2-00a56e3f23ec": {"id":"e48237fd-9971-4c7f-82f2-00a56e3f23ec","project_id":14266,"key":36582080,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.851Z","updated_at":"2022-09-26T00:29:29.851Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#87189d\" data-type=\"color\"\u003eBe aware\u003c/span\u003e\u003c/strong\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThere is no one set way criminals carry out whaling. In addition to standard phishing techniques, such as tricking users to click on fraudulent links, they may try to lure victims into false friendships or capture them in a blackmail scam.  \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eYou are potentially a ‘high-value’ target, so you must show an extra level of care. Not only in how you use IT at work, but also in what you share publicly via social media and how you use your own personal IT devices. \u003c/p\u003e"},"type":"Text"}, 
    "70fcfb88-b17d-4463-be72-ef9f61172c3f": {"id":"70fcfb88-b17d-4463-be72-ef9f61172c3f","project_id":14266,"key":36582079,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.845Z","updated_at":"2022-09-26T00:29:29.845Z","props":{"content":"\u003ch1 data-type=\"heading-one\"\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003eKnow your ICT assets\u003c/span\u003e\u003c/strong\u003e\u003cstrong data-type=\"bold\"\u003e\u003cspan style=\"color:#00b2a9\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003e \u003c/strong\u003e\u003c/span\u003e\u003c/strong\u003e\u003c/h1\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThere are many kinds of ICT assets that you’ll be responsible for. Some will be unique to your organisation. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eAll should be clearly identified within your ICT asset management practices so that you can monitor their currency and plan for any business risks associated with them. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eHere’s one way of slicing the ICT asset cake.…\u003c/p\u003e"},"type":"Text"}, 
