    "3a0f2e77-68f8-4d06-8062-d404cce2b117": {"id":"3a0f2e77-68f8-4d06-8062-d404cce2b117","project_id":14266,"key":36581999,"version":null,"meta":{"subType":"Media"},"children":[{"id":"ca721edf-8481-4b7a-b937-6e8c13d8d6fc","type":"Ref"},{"id":"5a524752-1712-4a8e-9d2f-e0a4e7d1aea4","type":"Ref"},{"id":"42000697-cdde-4cf0-9674-931f97dda075","type":"Ref"},{"id":"69bcead6-73dc-4ef1-b80f-aee4398916e3","type":"Ref"}],"deleted_at":null,"created_at":"2022-09-26T00:29:29.126Z","updated_at":"2022-09-26T00:29:39.124Z","props":{"name":"","style":{},"child":0,"src":"./images/FlipCard_default.svg"},"type":"Media"}, 
    "bbb83724-7237-463a-bced-63d04b94fe0c": {"id":"bbb83724-7237-463a-bced-63d04b94fe0c","project_id":14266,"key":36581998,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.117Z","updated_at":"2022-09-26T00:29:29.117Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat evening Xin receives an email that there has been an unexpected login to her Office 365 account from outside Australia. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eA week later The Age releases an article on leaked sensitive documentation for a controversial project Xin is in charge of.\u003c/p\u003e"},"type":"Text"}, 
    "9faaa5b0-62d2-4646-936b-50136058ba4e": {"id":"9faaa5b0-62d2-4646-936b-50136058ba4e","project_id":14266,"key":36581997,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.110Z","updated_at":"2022-09-26T00:29:29.110Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eHowever, the link has embedded code to download spyware onto her computer. Spyware allows hackers to remotely watch and record Xin’s actions on her computer.\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eThe hacker can record the keystrokes for her Office 365 password. \u003c/p\u003e"},"type":"Text"}, 
    "6593fbaa-5081-4bb6-a6ec-81e585f549be": {"id":"6593fbaa-5081-4bb6-a6ec-81e585f549be","project_id":14266,"key":36581996,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.103Z","updated_at":"2022-09-26T00:29:29.103Z","props":{"content":"\u003cdiv style=\"text-align:center\" data-type=\"textAlignCenter\"\u003e\u003ch1 data-type=\"heading-one\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003e\u003cstrong data-type=\"bold\"\u003eThink before you click\u003c/strong\u003e\u003c/span\u003e\u003c/h1\u003e\u003ch1 data-type=\"heading-one\"\u003e\u003c/h1\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003cspan style=\"color:#ffffff\" data-type=\"color\"\u003eSo to wrap up…\u003c/span\u003e\u003c/h3\u003e\u003c/div\u003e"},"type":"Text"}, 
    "366f91fe-ed31-447e-b6ee-551f7f16f7f6": {"id":"366f91fe-ed31-447e-b6ee-551f7f16f7f6","project_id":14266,"key":36581995,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.095Z","updated_at":"2022-09-26T00:29:29.095Z","props":{"src":"images/image_1369.gif","imageId":1369},"type":"Image"}, 
    "892f814a-d41f-4e33-9ad8-f29bab64306f": {"id":"892f814a-d41f-4e33-9ad8-f29bab64306f","project_id":14266,"key":36581994,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.089Z","updated_at":"2022-09-26T00:29:29.089Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eNot quite\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eShe should never click on a link in a suspicious email. On a laptop she could check a link by hovering over it. If she is on a mobile, she could press and hold the link to see if it looks okay. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eIf it looks like a scam then she should report it using the ‘Report Spam’ button. There’s no need to reporting to ICT security team unless she needs to escalate the incident if she did open the link.\u003c/p\u003e"},"type":"Text"}, 
    "38ce1fae-1d87-4fef-ac00-b55096b4ed31": {"id":"38ce1fae-1d87-4fef-ac00-b55096b4ed31","project_id":14266,"key":36581993,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.083Z","updated_at":"2022-09-26T00:29:29.083Z","props":{"src":"images/image_1368.gif","imageId":1368},"type":"Image"}, 
    "662f1f38-a9a4-4e26-bb7a-7be0f1f397bb": {"id":"662f1f38-a9a4-4e26-bb7a-7be0f1f397bb","project_id":14266,"key":36581992,"version":null,"meta":null,"children":[],"deleted_at":null,"created_at":"2022-09-26T00:29:29.077Z","updated_at":"2022-09-26T00:29:29.077Z","props":{"content":"\u003cp data-type=\"paragraph\"\u003eThat\u0026#x27;s right\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eShe should never click on a link in a suspicious email. On a laptop she could check a link by hovering over it. If she is on a mobile, she could press and hold the link to see if it looks okay. \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003eIf it looks like a scam then she should report it using the ‘Report Spam’ button. There’s no need to reporting to ICT security team unless she needs to escalate the incident if she did open the link.\u003c/p\u003e"},"type":"Text"}, 
